import React from 'react';

class table extends React.Component {
    constructor(props){
        super(props);
        this.state = {
        }
    }
    campaigTable () {
        console.log(this.props.dt)
        var data = this.props.dt.map((n)=>{
            return <> 
                <table className="table table-borderless">
                <thead className="thead-light">
                    <tr>
                        <th scope="col">Campaign name</th>
                        <th scope="col"><i className="fa fa-exclamation-circle fa-2x" aria-hidden="true" /></th>
                        <th scope="col">Overall budget</th>
                        <th scope="col">Curently used amount</th>
                        <th scope="col">Curently usage rate</th>
                        <th scope="col">start date</th>
                        <th scope="col"> End date</th>
                        <th></th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                    <th>n.campaignName</th>
                    </tr>
                    <tr>
                    
                        <td>
                            <div>
                                <p>n.lineItemId</p>
                                <p>n.lineItemName</p>
                            </div>
                        </td>
                        <td>
                            <div className="round1">
                                <input type="checkbox" id="checkbox"/>
                                <label htmlFor="checkbox" />
                            </div>
                        </td>
                        <td>n.overallBudget</td>
                        <td>n.curentlyUsedAAmount</td>
                        <td>n.curentlyUsageRate</td>
                        <td>n.startDate</td>
                        <td>n.endDate</td>
                        <td><i className="fa fa-pencil-square-o" aria-hidden="true"></i></td>
                    </tr>
                    
                </tbody>
            </table>
            </>
            }
            )
            
            return data;
    }
    render() { 
        var dta= this.campaigTable;
        console.log(dta);
        return ( 
            <> 
            {dta}
            </>
         );
    }
}
 
export default table;
